import React from 'react'


const ApiEsterna = ({promotions}) =>{
    return(
        <di>
            <img src={promotions.imageUrl} alt={promotions.title} />
            <div>
                <h1>{promotions.title}</h1>
                <span>R$: {promotions.price} </span>
                <footer>
                    {promotions.comments.length > 0 &&(
                        <div>
                            {promotions.comments[0].comment}
                        </div>
                    )}
                    <div> {promotions.comm} </div>
                </footer>
            </div>
        </di>
    )

}
export default ApiEsterna;
